import React from 'react'
import {Col} from "react-bootstrap";

const Nike = () => {
  return (
    <Col md={4}>
      <img src={'/img/nike/nike1.jpg'} width='80%' alt="shoes" />
      <h4>{'에어 줌 인피니티 투어 넥스트'}</h4>
      <p>{'남성 골프화(와이드)'}</p>
      <p>{'259001'}</p>
      </Col>   
  )
}

export default Nike
